import React from 'react';
import { useLocation } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Stepper from '../components/Stepper';

function FourthStep() {
    const { state } = useLocation(); 
    const { completeData } = state || {}; // Use 'completeData' from the state

    // Destructure data from completeData
    const {
        firstName = '',
        lastName = '',
        age = { month: '', day: '', year: '' },
        hasDisability = '',
        disabilityFile = null,
        mealPlanChoice = '',
        daysRequested = [],
        street = '',         // This variable is unused
        city = '',           // This variable is unused
        state: deliveryState = '', // This variable is unused
        zipCode = '',        // This variable is unused
        Apartment = '',      // This variable is unused
        deliveryInstructions = '',
        phoneNumber = { areaCode: '', number1: '', number2: '' },
        secondaryPhoneNumber = { areaCode: '', number1: '', number2: '' },
        email = '',
    } = completeData || {}; // Default to empty object if completeData is undefined

    // Combine phone number parts into one variable for display
    const phoneCountryCode = phoneNumber.areaCode;
    const phoneNumberFull = `${phoneNumber.number1}-${phoneNumber.number2}`;
    const secondaryPhoneNumberFull = `${secondaryPhoneNumber.areaCode}-${secondaryPhoneNumber.number1}-${secondaryPhoneNumber.number2}`;

  return (
    <div className="container mt-5">
      <Stepper currentStep={4} />

      <h2 className="mb-4">4. Review and Confirm</h2>

      {/* First Row: Applicant's Info */}
      <div className="row mb-3">
        <div className="col">
          <strong>Applicant's Name:</strong> {firstName} {lastName}
        </div>
        <div className="col">
          <strong>Age:</strong> {`${age.month}/${age.day}/${age.year}`}
        </div>
        <div className="col">
          <strong>Do You Have a Disability?</strong> {hasDisability}
        </div>
        {hasDisability === 'Yes' && (
          <div className="col">
            <strong>Disability Documentation:</strong>{' '}
            {disabilityFile ? disabilityFile.name : 'No File Uploaded'}
          </div>
        )}
      </div>

      {/* Second Row: Meal Plan and Days Requested */}
      <div className="row mb-3">
        <div className="col">
          <strong>Meal Plan Choice:</strong> {mealPlanChoice || 'Not Selected'}
        </div>
        <div className="col">
          <strong>Days Requested:</strong>{' '}
          {daysRequested.length ? daysRequested.join(', ') : 'None'}
        </div>
      </div>

      {/* Third Row: Delivery Address */}
      <div className="row mb-3">
        <div className="col">
          <strong>Delivery Address:</strong> {deliveryAddress || 'Not Provided'}
        </div>
      </div>

      {/* Fourth Row: Delivery Instructions */}
      <div className="row mb-3">
        <div className="col">
          <strong>Delivery Instructions:</strong> {deliveryInstructions || 'None'}
        </div>
      </div>

      {/* Fifth Row: Phone Number and Email */}
      <div className="row mb-3">
        <div className="col">
          <strong>Phone Number:</strong>{' '}
          {`${phoneCountryCode} ${phoneAreaCode} ${phoneNumber}`}
        </div>
        <div className="col">
          <strong>Email:</strong> {email}
        </div>
      </div>

      {/* Signature Section */}
      <div className="row mb-3">
        <div className="col">
          <label>Type Name Here to Virtually Sign Document</label>
          <input
            type="text"
            name="signature1"
            className="form-control"
            placeholder="Signature"
            required
          />
        </div>
        <div className="col">
          <label>Type Name Here to Virtually Sign Document</label>
          <input
            type="text"
            name="signature2"
            className="form-control"
            placeholder="Signature"
            required
          />
        </div>
      </div>

      {/* Navigation Buttons */}
      <div className="d-flex justify-content-between">
        <button type="button" className="btn btn-secondary">
          Back
        </button>
        <button type="button" className="btn btn-primary">
          Confirm & Submit
        </button>
      </div>
    </div>
  );
}

export default FourthStep;
